import { gql } from "@apollo/client";

const vendorList = gql`
query Vendor {
    vendor {
      vendorList {
        name
        email
        phoneNumber
        createdAt
        updatedAt
        _id
        count
        token
        image
        totalSum
      }
      totalCount
      message
      code
    }
  }`

export default vendorList;
